import styled from  "styled-components";

export const CardContainer = styled.div`
    display: flex;
    padding: 5px;
    padding-top: 25px;
    padding-bottom: 25px;
    flex-direction: column;
    border-radius: 30px;
    border: 3px solid ;
    background-position: center;
    background-color: #C4BBAF;
    background-size: cover;
    cursor: pointer;
`;
